For those who may be unaware, Supermayer is an established and respectable name in the fields of tech house / minimal techno, techno in general and sometimes what is termed ambient techno.  They are a collaboration of two artists, Superpitcher &amp; Michael Mayer who are notable for their releases on the most distinguished Kompakt label.


